import img1 from "assets/images/fondo3.jpg"
import img2 from "assets/images/fondo4.jpg"
import img3 from "assets/images/fondo5.png"



function Carrusel() {
  return (
    <Container>
    <Carousel>
      <Carousel.Item>
        <Image
          src={img1}
          alt="Comienzos de integraci贸n a invernadero"
          style={{ height: "35vw", width: "100%",}} 
          fluid
        />
        <Carousel.Caption>
          <h3>Comienzos de integraci贸n a invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Image
          src={img2}
          alt="Forma ejemplificada del invernadero"
          style={{ height: "35vw", width: "100%" }} 
          fluid
        />
        <Carousel.Caption>
          <h3>Forma ejemplificada del invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Image
          src={img3}
          alt="Comienzos de integraci贸n a invernadero"
          style={{ height: "35vw", width: "100%",}} 
          fluid
        />
        <Carousel.Caption>
          <h3>Comienzos de integraci贸n a invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  </Container>
  );
};

export default Carrusel;
